const yamlFilePath="https://api.rfmsconnect.nl:9123/sdk/docs/api_endpoints.yaml";function fetchAndParseYaml(e){return fetch(e).then((e=>{if(!e.ok)throw new Error(`Failed to fetch YAML file: ${e.status} ${e.statusText}`);return e.text()})).then((e=>{try{return jsyaml.load(e)}catch(e){throw new Error(`Error parsing YAML: ${e.message}`)}}))}function generateHtml(e){let t="";for(const n in e){t+=`<div class="group-header">\n                    <h4>${n.charAt(0).toUpperCase()+n.slice(1)}</h4>\n                </div>\n                <div class="group-endpoints">`;const a=e[n];for(const e of a)for(const n in e){const a=e[n],s=a.method||"GET",r=a.path||"",o=a.description||"",d=a.parameters||[],l=a.response||{};if(t+=`<section id="${r}" class="endpoint-section">\n                            <div class="endpoint-header" data-bs-toggle="collapse" data-bs-target="#collapse-${r}" aria-expanded="false" aria-controls="collapse-${r}">\n                                <span class="method method-${s.toLowerCase()}">${s}</span>\n                                <h4>${n.charAt(0).toUpperCase()+n.slice(1)}</h4>\n                                <span class="endpoint">${r}</span>\n                            </div>\n                            <div id="collapse-${r}" class="collapsible-content collapse">\n                                <p>${o}</p>`,d.length>0){t+='<div class="request-params">\n                                <h4>Request Parameters</h4>\n                                <table class="params-table">\n                                    <thead>\n                                        <tr>\n                                            <th>Parameter</th>\n                                            <th>Type</th>\n                                            <th>Required</th>\n                                            <th>Description</th>\n                                        </tr>\n                                    </thead>\n                                    <tbody>';for(const e of d)t+=`<tr>\n                                    <td><span class="param-name">${e.name||""}</span></td>\n                                    <td>${e.type||""}</td>\n                                    <td>${e.required?"Yes":"No"}</td>\n                                    <td>${e.description||""}</td>\n                                </tr>`;t+="</tbody>\n                                </table>\n                            </div>"}t+=`<div class="response-example">\n                            <h4>Response Example (YAML)</h4>\n                            <div class="yaml-viewer"><pre>${jsyaml.dump(l,{indent:2})}</pre></div>\n                        </div>\n                    </div>\n                </section>`}t+="</div>"}return t}function renderHtml(e){document.getElementById("api-content").innerHTML=e;document.querySelectorAll('[data-bs-toggle="collapse"]').forEach((e=>{new bootstrap.Collapse(e)}))}function loadAndDisplayApiReference(){fetchAndParseYaml(yamlFilePath).then((e=>{renderHtml(generateHtml(e))})).catch((e=>{document.getElementById("api-content").innerHTML=`<div class="alert alert-danger">Error: ${e.message}</div>`,console.error(e)}))}document.addEventListener("DOMContentLoaded",loadAndDisplayApiReference);